import React, { Component } from 'react';

class Resume extends Component {
  render() {

    if(this.props.data){

      var education = this.props.data.education.map(function(education){
        return (
        <div key={education.school}><h3>{education.school}</h3>
        <p className="info">{education.degree} <span>&bull;</span><em className="date">{education.graduated}</em></p>
        <p>{education.description}</p></div> );
      })
      var work = this.props.data.work.map(function(work){
        return <div key={work.company}><h3>{work.company}</h3>
            <p className="info">{work.title}<span>&bull;</span> <em className="date">{work.years}</em></p>
            <p>{work.description}</p>
        </div>
      })

      // Map Certifications Section
      var certifications = this.props.data.certifications.map(function (certification) {
        return (
          <div key={certification.title}>
            <h3>{certification.title}</h3>
            <p className="info">
              {certification.organization} <span>&bull;</span>
              <em className="date">{certification.date}</em>
            </p>
          </div>
        );
      });
    }

    return (
      <section id="resume">

        {/* Work Experience Section */}
      <div className="row work">
          <div className="three columns header-col">
            <h1>
              <span>Work Experience</span>
            </h1>
          </div>

          <div className="nine columns main-col">
            <div className="row item">
              <div className="twelve columns">{work}</div>
            </div>
          </div>
        </div>

        <div className="row certifications">
  <div className="three columns header-col">
    <h1>
      <span>Certifications</span>
    </h1>
  </div>

  <div className="nine columns main-col">
    {this.props.data.certifications.map((certification) => (
      <div className="row item" key={certification.title}>
        <div className="twelve columns">
          <h3>{certification.title}</h3>
          <p className="info">
            {certification.organization} <span>&bull;</span>
            <em className="date">{certification.date}</em>
          </p>
        </div>
      </div>
    ))}
  </div>
</div>


      <div className="row education">
         <div className="three columns header-col">
            <h1><span>Education</span></h1>
         </div>

         <div className="nine columns main-col">
            <div className="row item">
               <div className="twelve columns">
                 {education}
               </div>
            </div>
         </div>
      </div>

   </section>
    );
  }
}

export default Resume;
